import React from "react";
import Card from "./elements/Card";

class CardList extends React.Component {

  apples = [["Quantity", "42"],
      ["Name", "Apples"],
      ["Origin", "Canada"],
      ["Price", "$1.69/lb"]];


  render() {
    return (
      <div>
        <Card />
      </div>
    );
  }
}

export default CardList;
